import React, { Component } from 'react';
import Chip from '@material-ui/core/Chip';

const Style = {
    react: {
        color: 'lightblue',
        fontWeight: 'bolder',
        borderWidth: 2,
        borderColor: 'lightblue'
    }
};

export default class ChipsReact extends Component {
    render() {
        return (
            <Chip label="React" variant="outlined" style={Style.react}/>
        );
    }
}
